import Button from "../UI/Button/Button";
import SubHeaderPage from "./SubHeader";
import classes from "./header.module.css";

function Header() {
  return (
    <header>
      <nav className={classes.main_nav}>
        <Button size="lg" theme="main">
          Logo
        </Button>
        <div className={classes.middle_nav}>
          <Button size="lg" theme="dark">
            Jobs
          </Button>
          <Button size="lg" theme="text">
            Message
          </Button>
          <Button size="lg" theme="text">
            Payment
          </Button>
        </div>
        <Button size="sm" theme="text">
          Logo
        </Button>
      </nav>
    </header>
  );
}

export default Header;
